Happy Valentine’s Day! ❤️ Today is a day that is, more than anything, about spreading love and kindness so today we want to bring our community together to help those suffering and mourning the loss of their loved ones from the devastating 7.8 magnitude earthquake that struck Turkey and Syria last week. Eight days after the crippling quake and its violent aftershocks, more than 41,200 people have been confirmed dead 💔

Rescue personnel have been racing against time to save victims. Truck shortages, blocked roads and other logistical hurdles are impeding efforts of rescue workers to unearth victims, bury the dead and provide shelter, food and medical aid to desperate survivors. Subfreezing temperatures and widespread shortages of heating and electricity are making their work extremely difficult 😞 

According to CNN, Turkey rescuers say voices are still being heard under the rubble TODAY 💔

HOW YOU CAN HELP 🙏🏼
The following is a list of charitable and humanitarian organizations that are aiding the relief effort that you can donate to:

@UnicefUSA – The United Nations Children’s Agency said 4.6 million children live in the 10 Turkish provinces hit by the disaster, while in Syria, 2.5 million children have been affected. UNICEF is on the ground helping children and families impacted by the quake. 

@ibctr – Has offices in Gaziantep, Turkey, near the epicenter of the quake, and has been working to dispatch teams to affected communities in both Turkey and Syria. 

@SaveTheChildren – An international youth humanitarian aid group that has teams on the ground to help earthquake victims.

@the_whitehelmets – Humanitarian aid organization that operates in areas of war-torn Syria where public services no longer function.

If you have additional tips for how our community can #HelpTurkey and #HelpSyria please leave them in the comments below 👇🏼 Thank you for caring! 🙏🏼❤️

